import React from "react";
// import ProductArray from "./ProductArray/ProductArray";

export default function Product(description) {
    return (
        <div>
            <ul>
            <li>Name: {description.title}</li>
            <li>Price: {description.price}</li>
            </ul>
        </div>
    )
}
